f \u0445\u043e\u0434\u0438\u043b\u0430 \u0441 \u0440\u044e\u043a\u0437\u0430\u043a\u043e\u043c, \u0438\u0437\u043c\u0435\u0440\u044f\u044e\u0449\u0438\u043c \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0437\u0430\u0433\u0440\u044f\u0437\u043d\u0435\u043d\u0438\u044f \u0432\u043e\u0437\u0434\u0443\u0445\u0430. \u041e\u0442 \u0434\u043e\u043c\u0430 \u0434\u043e \u0442\u0440\u0435\u043d\u0438\u0440\u043e\u0432\u043a\u0438 \u0438 \u043f\u043e \u0432\u0441\u0435\u043c \u0432\u0430\u0436\u043d\u044b\u043c \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u043c. \u0418 \u0437\u043d\u0430\u0435\u0442\u0435 \u0447\u0442\u043e? \n\u041e\u0447\u0435\u0432\u0438\u0434\u043d\u043e, \u0447\u0442\u043e \u0432\u043e\u0437\u0434\u0443\u0445\u043e\u043c \u043e\u043a\u043e\u043b\u043e \u0434\u043e\u0440\u043e\u0433 (\u043f\u043e\u0447\u0442\u0438 \u043b\u044e\u0431\u044b\u0445) \u0434\u044b\u0448\u0430\u0442\u044c \u043d\u0435 \u0441\u0442\u043e\u0438\u0442, \u0438 \u0434\u0430\u0436\u0435 \u0435\u0437\u0434\u0438\u0442\u044c \u0441 \u043e\u0442\u043a\u0440\u044b\u0442\u044b\u043c \u043e\u043a\u043d\u043e\u043c \u0430\u0432\u0442\u043e, \u0441\u043b\u0438\u0448\u043a\u043e\u043c \u0432\u044b\u0441\u043e\u043a\u0430\u044f \u043a\u043e\u043d\u0446\u0435\u043d\u0442\u0440\u0430\u0446\u0438\u044f \u0432\u044b\u0445\u043b\u043e\u043f\u043d\u044b\u0445 \u0433\u0430\u0437\u043e\u0432, \u0431\u0435\u043d\u0437\u043e\u043b\u0430 \u0438 \u043c\u0435\u043b\u043a\u0438\u0445 \u0447\u0430\u0441\u0442\u0438\u0446. \u041d\u0430 \u0444\u0443\u0434\u043a\u043e\u0440\u0442\u0435, \u043a\u0430\u043a \u043d\u0438 \u0441\u0442\u0440\u0430\u043d\u043d\u043e, \u0442\u043e\u0436\u0435 \u043d\u0435\u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e \u0438\u0437-\u0437\u0430 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u043e\u0432 \u0433\u043e\u0440\u0435\u043d\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0432\u043e\u0437\u043d\u0438\u043a\u0430\u044e\u0442 \u043f\u0440\u0438 \u0436\u0430\u0440\u043a\u0435 . \n\u0422\u0435\u043d\u043d\u0438\u0441\u043d\u044b\u0439 \u043a\u043e\u0440\u0442 \u0442\u043e\u0436\u0435 \u043f\u043e\u043b\u043e\u043d \u0430\u043b\u043b\u0435\u0440\u0433\u0435\u043d\u043e\u0432 \u0432 \u0432\u0438\u0434\u0435 \u043c\u0435\u043b\u044c\u0447\u0430\u0439\u0448\u0438\u0445 \u0447\u0430\u0441\u0442\u0438\u0446, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043f\u043e\u043f\u0430\u0434\u0430\u044e\u0442 \u0432 \u043b\u0451\u0433\u043a\u0438\u0435 \u043f\u0440\u0438 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u043c \u0434\u044b\u0445\u0430\u043d\u0438\u0438.\n\n\u042d\u0442\u043e \u043d\u0435 \u0437\u043d\u0430\u0447\u0438\u0442, \u0447\u0442\u043e \u0442\u0435\u043f\u0435\u0440\u044c \u0432\u043e\u043e\u0431\u0449\u0435 \u043d\u0435 \u0441\u0442\u043e\u0438\u0442 \u0436\u0438\u0442\u044c \ud83d\ude05\n\u041f\u0440\u043e\u0441\u0442\u043e \u0435\u0449\u0451 \u0432\u0430\u0436\u043d\u0435\u0435 \u0441\u0442\u0430\u043b\u043e \u0447\u0430\u0449\u0435 \u0431\u044b\u0432\u0430\u0442\u044c \u043d\u0430 \u0441\u0432\u0435\u0436\u0435\u043c \u0432\u043e\u0437\u0434\u0443\u0445\u0435 \u043f\u043e\u0434\u0430\u043b\u044c\u0448\u0435 \u043e\u0442 \u0433\u043e\u0440\u043e\u0434\u0430 \u0438 \u043d\u0430\u0441\u043b\u0430\u0436\u0434\u0430\u0442\u044c\u0441\u044f \u043f\u0440\u0438\u0440\u043e\u0434\u043e\u0439\ud83c\udf3f\n\n\u0422\u0430\u043a\u0436\u0435 \u0441\u043e\u0432\u0435\u0442\u0443\u044e \u0435\u0437\u0434\u0438\u0442\u044c \u0441 \u0437\u0430\u043a\u0440\u044b\u0442\u044b\u043c \u043e\u043a\u043d\u043e\u043c \u0432 \u043c\u0430\u0448\u0438\u043d\u0435, \u043c\u0435\u043d\u044c\u0448\u0435 \u0441\u043e\u043f\u0440\u0438\u043a\u0430\u0441\u0430\u0442\u044c\u0441\u044f \u0441 \u0430\u044d\u0440\u043e\u0437\u043e\u043b\u044f\u043c\u0438/\u0430\u0440\u043e\u043c\u0430\u0442\u0438\u0437\u0430\u0442\u043e\u0440\u0430\u043c\u0438  \u0438 \u0441\u043f\u0440\u0435\u044f\u043c\u0438 \u0438 \u043f\u043e\u043c\u0435\u043d\u044c\u0448\u0435 \u0436\u0430\u0440\u
